ocytes above the basal layer, with a low proliferation rate in both junctional and dermal components. The features still favor a dysplastic (Clark's) nevus rather than melanoma with respect to the initial lesion.  On the basis of morphology, I favor a thin melanoma over a dysplastic (Clark's) nevus in regard to the current persistent/recurrent lesion. A re-excision is certainly appropriate, as the lesion is less than 1 mm. from the margin. We performed comparative genomic hybridization to see if unequivocal findings of melanoma were present. There were several low level aberrations (this may indicate aberrations in a minority of cells, with the effect in in our array graph muted by the presence of other melanocytes without these copy number changes). The aberrations are in areas not typically affected in melanoma, including gains in chr. 2p and 7q, and a loss in 3q. Given these idiosyncratic findings, I asked my colleague and the director of our molecular lab, Dr. Boris Bastian to review the comparative genomic hybridization data. He stated that he would be unable to make a diagnosis of melanoma based on the data alone.  In sum, this is a difficult and borderline recurrent lesion whose differential diagnosis includes a thin melanoma, but falls short of being unequivocal diagnostic, either morphologically, with immunoperoxidase stains or molecular methods.	SCAR AND PERSISTENT COMPOUND PROLIFERATION OF MELANOCYTES WITH ATYPICAL FEATURES	173505	1878	\N	T	12-97432	A	SYNAT274	2010-2017	IP300725	AirTable blocks_with_IP_info.csv
