e chromosomal copy number aberrations indicates genomic instability, as is stereotypical of malignancies such as melanoma. The aCGH profile that we have defined is incompatible with a benign interpretation.  In summary, the combination of results derived from conventional microscopy coupled with aCGH demonstrates that this atypical melanocytic tumor represents melanoma that has developed secondarily in a blue nevus. This entity can be referred to as 'blue nevus-like melanoma'. With respect to staging, this melanoma is between 1-2 mm in thickness and lacks associated ulceration in the current sections. Therefore, it provisionally represents melanoma of stage pT2a (2009 AJCC Guidelines). The final microstage parameters can be reassessed once this melanoma has been fully extirpated.  This report was reissued on April 24, 2014, to add the patient's UCSF Medical Record number and to forward a copy to UCSF Medical Records.	MELANOMA OF AT LEAST 1.8 MM IN THICKNESS, ARISING IN ASSOCIATION WITH A BLUE NEVUS	100678	2002	\N	L	13-3732	A	SYNAT277	2010-2017	IP1188475	AirTable blocks_with_IP_info.csv
