2040	17-6351	21	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	There is a polypoid segment of skin with a mostly intradermal proliferation of large, oval melanocytes with abundant pale homogeneous appearing cytoplasm and large, oval vesicular nuclei with relatively small nucleoli. These cells are arranged as closely apposed small aggregations with intervening lymphocytes.	One outside slide, 17-013-P82-0021-0 A1 and one corresponding block.	MOLE REMOVAL	\N	\N	\N	The differential diagnosis included an atypical Spitz tumor and a spitzoid melanoma. A BAP-1 immunostain labels the nuclei of keratinocytes in the overlying epidermis, those of lymphocytes and those of the smaller melanocytes, but not the larger, spitzoid ones. This is consistent with BAP-1 loss in the larger spitzoid cells. This loss can be due to mutation in one allele and loss of the other, or to epigenetic mechanisms.  A p16 immunoperoxidase stain does not show significant loss of that tumor suppressor gene product (nearly complete or complete loss in a defined zone is worrisome for melanoma). As loss of p16 can follow BAP-1 loss in multi-step progression toward melanoma, this is a reassuring finding.  A phosphohistone H3/MART-1/tyrosinase two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) shows up to four mitotic figures in dermal melanocytes/section.  Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows only an interstitial loss in chr. 3p around the area of the BAP-1 gene, and no other gains or losses. This is against progression toward melanoma.  Using the DNA extracted for this procedure, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  In sum, the findings are those of an atypical Spitz tumor with BAP-1 loss, but not progression toward a BAP-1 deficient spitzoid melanoma. A narrow re-excision of this site would still be prudent, as lesions with BAP-1 loss may convert to melanoma at a higher rate than other spitzoid neoplasms.  Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	ATYPICAL SPITZ TUMOR WITH BAP-1 LOSS	173500	722	\N	\N	17-6351	\N	DP-85	CGH Validation	IP1735471	AirTable blocks_with_IP_info.csv
