1932	16-19895	36	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show melanocytes arrayed in compound fashion with acanthosis. The cells are generally fusiform and finely pigmented. There are large nests and fascicles of melanocytes in the epidermis, and maturing nests, cords, and fascicles of similar melanocytes are in the dermis and also in adnexa. A lymphohistiocytic infiltrate with admixed melanophages is also noted. Some pink globules can be found in the intraepidermal, although they are incompletely formed.	Five outside slides, AID16-01165 A (CN16-374) and one corresponding block.	IMPRESSION WAS PINK PAPULE; REQUEST FOR MOLECULAR ANALYSIS	\N	\N	\N	This biopsy does not demonstrate melanoma. Rather, it demonstrates characteristics that are typical of a variant of Spitz nevus, namely a Spitz nevus with underlying NTRK1 gene fusion. Immunostaining with NTRK1 has been completed and demonstrates avid positivity, and this labeling result corroborates that NTRK1 gene fusion is present. We additionally completed array-based comparative genomic hybridization (aCGH) to screen for copy number loss as a means to fully exclude melanoma from the differential diagnosis. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed a slightly noisy tracing (with possible/equivocal subthreshold loss in chromosome 19) with no significant chromosomal gains or losses. As background for understanding this result, note that most melanomas analyzed via aCGH demonstrate multiple associated chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations. There is a small segmental loss in chromosome 1q at the location of the NTRK1 gene, and it seems likely that this is a consequence of gene fusion. The gene fusion partner cannot be identified by means of the aCGH technique.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of melanoma. Rather, our results substantiate the diagnosis of Spitz nevus with underlying kinase gene fusion. Please note that this melanocytic tumor involves the edge of the biopsy, and thus conservative complete reexcision of this site can be considered as follow-up management. The intent of reexcision is simply to ensure complete removal and verify that persistence with additional transformation cannot ensue.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	COMPOUND SPITZ NEVUS WITH ASSOCIATED NTRK1 GENE FUSION, FOCALLY TRANSECTED AT THE PERIPHERY OF THE BIOPSY	273578	693	\N	\N	16-19895	\N	DP-56	CGH Validation	IP1619022	AirTable blocks_with_IP_info.csv
