1951	16-42198	48	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	216.6	\N	\N	There is a dome surfaced, wedge shaped proliferation of large oval and fusiform melanocytes with abundant pale cytoplasm and large, moderately pleomorphic vesicular nuclei that mature and disperse evenly with descent, with preservation of p16 staining.	Nine outside slides, MS16-8430-1A. One corresponding block received 6/3/16.	RUA SKIN LESION	\N	\N	\N	The accompanying cover letter detailing fluorescence in situ hybridization studies mentions hemizygous deletions of all four chromosomal loci that were tested. I have not encountered this, and asked my colleague, Dr. Boris Bastian, who developed the FISH test for melanoma, for his comments. He was skeptical of this result, and suggested that the testing was done on sections that were too thin. Otherwise, the findings appear to be those of a Spitz's nevus with a characteristic domed surface, wedge shaped base and diminishing cellularity toward the base of the lesion. The retention of p16 is a reassuring finding. A zone of granulation tissue implying a prior biopsy site is present, with a limitation of this evaluation being that if so, the sections from the biopsy are not included.  The margins appear clear in the planes of section examined.  We then tried to verify or refute the presence of chromosomal copy number changes by comparative genomic hybridization, per your message.  Following microdissection and DNA extraction, we performed comparative genomic hybridization. It shows an isolated gain involving chromosome 11p, but no other aberrations, implying that the impression of hemizygous deletions was artifactual. Isolated 11p gain usually corresponds to two copies of 11p joined by a centromere, and has not been seen to date in melanoma. Spitz's nevi with this aberration are likely to have a mutation involving h-ras, and to deeply infiltrate the reticular dermis as single cells, findings that are present here.  References:  van Engen-van Grunsven AC, van Dijk MC, Ruiter DJ, Klaasen A, Mooi WJ, Blokx WA. HRAS-mutated Spitz tumors: A subtype of Spitz tumors with distinct features. Am J Surg Pathol. 2010 Oct;34(10):1436-41.  Bastian BC, LeBoit PE, Pinkel D. Mutations and copy number increase of HRAS in Spitz nevi with distinctive histopathological features. Am J Pathol. 2000 Sep;157(3):967-72.	SPITZ'S NEVUS, PREDOMINANTLY INTRADERMAL	173688	707	\N	\N	16-42198	\N	DP-70	CGH Validation	IP1641515	AirTable blocks_with_IP_info.csv
