1413	10-59344	9	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	There is a proliferation of melanocytes with a domed surface and a wedge-shaped base. The overlying epidermis is alternatively thinned and irregularly thickened. There are large, confluent nests of cells with relatively monomorphous oval vesicular nuclei and abundant pale amphophilic cytoplasm. Many mitotic figures are present both in the upper and lower parts of the lesion. Both maturation, and dispersion to smaller aggregations toward the inferior edge of the specimen is evident.	Six outside slides, D10-9923 (1&2) and one corresponding block (1).	BX PROVEN ATYPICAL NEVUS, UNUSUAL MELANOCYTIC NEOPLASM, FAVOR SPITZ'S NEVUS, CHECK MARGINS	\N	\N	\N	This lesion has some features that make a conventional Spitz's nevus unlikely, including a thinned epidermis, the extent of confluence of nests and the number of mitotic figures, some of them in the lower half of the lesion. The more striking cytologic atypia seen in the lesions that I term spitzoid melanoma of childhood is not evident. Similar lesions to this one have been reported under a variety of names, including atypical Spitz tumor. They tend to involve local (and sentinel) lymph nodes at a relatively high rate, but distant metastasis is unlikely. Given the sharp circumscription of the lesion, one could consider a re-excision of this site, but I have not seen lesions of this type recur when excised by even a few millimeters. With regard to sentinel lymph node biopsy, there is little prognostic information as there is such a disparity between a percent of patients with nodal involvement and distant metastases. Comparative genomic hybridization does not show clear-cut evidence of chromosomal gains or losses. Because deflections were present in the plotted CGH data, we consulted with our former colleague, Dr. Boris Bastian (now chairman of Pathology at Memorial Sloan-Kettering Medical Center, New York) who agrees that no definite aberrations are present.