iated chromosomal gains or losses. We have observed anomalies involving chromosome 1 in other examples of spitzoid melanoma. In summary, my interpretation of the the combination of results derived from conventional microscopy coupled with aCGH analysis is that a nodule of childhood-type spitzoid melanoma has developed secondarily within a preexistent Spitz nevus. The nodular population of melanocytes within this specimen is 1.6 mm in thickness. Please note that the negative prior analysis via fluorescence in situ hybridization (FISH) is unsurprising, as FISH testing only evaluates loci on chromosomes 6 and 11. To state it differently, the chromosomal anomaly that we have detected could not be identified via FISH.  The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination. The proliferation in this specimen involves the deep edge of the biopsy. Further excision is warranted to ensure that local eradication has been accomplished.	BIPHASIC COMPOUND PROLIFERATION OF ENLARGED SPITZOID MELANOCYTES, INCLUDING A NODULAR POPULATION OF ATYPICAL MELANOCYTES WITH CHROMOSOME 1p LOSS	101624	2152	\N	\N	11-20375	\N	SYNAT157	2010-2017	IP1009813	AirTable blocks_with_IP_info.csv
