hould be completed shortly, thereby permitting finalization of this report.   2/18/2000:  This pattern is worrisome for regression of a melanocytic neoplasm, and these changes may represent partial regression of a superficial desmoplastic melanoma.	MELANOMA, 2.2 MM IN THICKNESS, WITH EXTENSIVE REGRESSION AND EXTENSION TO THE PERIPHERAL MARGIN	173649	236	\N	\N	00-4845	\N	CCR-311	California Cancer Registry	IP219948	AirTable blocks_with_IP_info.csv
2238	17-112474	67	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	172.5	\N	\N	None	Block DL17-76060 (S17-8234), received 11-16-17.	ORIGINALLY READ AS DL17-76060; REACCESSIONED FOR CGH TESTING	\N	\N	Scraping	Following microdissection and DNA extraction, we performed comparative genomic hybridization. The hybridization shows gain of chr. 6p, and a loss involving an area on chr. 6q with the ARID1B gene near its breakpoint. Gain of 6p and loss of 6q are commonly found together in melanoma, and the finding of a breakpoint at a gene important in melanomagenesis further supports that diagnosis. The biopsy and re-excision from this lesion correlate for an approximate thickness of 6 mm. A beta-catenin immunostain labels not only the cytoplasm of the lesional melanocytes but also their nuclei. This supports the assessment of a deep penetrating nevic lineage, per a recent study from our group. This lineage includes deep penetrating nevus, indeterminate lesions, and deep penetrating nevus-like melanoma.  In the re-excision, the neoplasm was a fraction of a mm. from the deep margin near the center of the specimen, and a further excision (still deeper, but not necessary wider) seems warranted.  The comparative genomic hybridization data was also reviewed by my colleague, Dr. Boris Bastian who agrees with this interpretation of it.  Reference:  Yeh I, Lang UE, Durieux E, Tee MK, Jorapur A, Shain AH, Haddad V, Pissaloux D, Chen X, Cerroni L, Judson RL, LeBoit PE, McCalmont TH, Bastian BC, de la FouchardiËre A. Combined activation of MAP kinase pathway and ﬂ-catenin signaling cause deep penetrating nevi. Nat Commun. 2017 Sep 21;8(1):644. doi: 10.1038/s41467-017-00758-3. PubMed PMID: 28935960; PubMed Central PMCID: PMC5608693.	MELANOMA, WITH DEEP PENETRATING NEVUS-LIKE FEATURES, 6  MM. IN THICKNESS	273588	246	\N	\N	17-112474	\N	CGH17-240	Nevus Library	IP1806028	AirTable blocks_with_IP_info.csv
