1808	14-90528	62	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	from Swapna	Sections show a domed compound proliferation of melanocytes with single cells and nests arrayed along the junction. The junctional melanocytes are pale and have heavily pigmented cytoplasm, and pigmented hyperkeratosis is above them. In the dermis, there are maturing nests, cords, and small syncytia of similar melanocytes, and those superficially are heavily pigmented, while those more deeply exhibit limited neural differentiation in a central focus. There are some superficial dermal or perijunctional melanocytes in mitosis. Many superficial dermal melanophages are also noted.	Five outside slides, SD-14-32477 (A1). One corresponding block received 10-28-14.	SECOND OPINION	\N	\N	\N	Given the small overall size, good lateral demarcation, gradient of maturation, and deep neural differentiation that are apparent in association with this tumor, I believe it represents melanocytic nevus and not melanoma. There are several perijunctional melanocytes in mitosis, which is unconventional and of some concern. That said, I do not see how a microscopic diagnosis of melanoma could be easily rendered, given the characteristics mentioned in the first sentence of this paragraph. Per a clinical request, we completed array-based comparative genomic hybridization (aCGH) to screen for genomic copy number anomalies as an ancillary means of assessment. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosome 15q as a monoaberration (and also subthreshold gain in chromosome 20q) with no other associated chromosomal gains or losses. As background for understanding this result, note that most melanomas analyzed via aCGH demonstrate multiple associated chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations. Gain in 15q is an anomaly that we have identified in a subset of melanocytic nevi with spitzoid features.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of melanoma. Rather, our analysis has identified an uncommon monoaberration that we have identified in a subset of Spitz nevi or partially transformed Spitz tumors. In the available sections, this melanocytic proliferation appears narrowly excised. Clinical monitoring of the biopsy site can be utilized to verify that no persistence ensues. Given the complexity of this assessment, conservative complete reexcision of this site could also be considered as follow-up management.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	COMPOUND PROLIFERATION OF HEAVILY PIGMENTED MELANOCYTES, CONSISTENT WITH A COMPOUND MELANOCYTIC NEVUS	897777	643	\N	\N	14-90528	\N	DP-06	Possible TERT Fusion	IP1440512	AirTable blocks_with_IP_info.csv
2279	17-132120	25	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	from Swapna	The lesion has a domed surface and a flat base. I has large polygonal and fusiform melanocytes with abundant, pale cytoplasm and dusty appearing melanin and enlarged nuclei superficially and smaller cells more deeply. Areas feature a syncytial arrangement, rather than discrete aggregations. I did not encounter mitotic figures in dermal melanocytes.	One outside slide, S-90406. One corresponding block received 1/10/18.	BIOPSY LEFT FOREARM	\N	\N	\N	The differential diagnosis posed by these sections includes a Spitz's nevus, an atypical Spitz tumor and spitzoid melanoma. The asymmetry of the lesion and presence of many cells with abundant, pale cytoplasm and dusty appearing melanin is against a Spitz's nevus and favors one of the other two categories. A phosphohistone H3/MART-1/tyrosinase two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) shows several positive nuclei in the upper or mid-part of the lesion.  While only a small minority of the melanocytes are p16 positive, I did not find extensive areas completely lacking p16 positive cells, as can be seen with bi-allelic loss of CDKN2A. Such areas can in some cases indicate melanoma.  Following microdissection and DNA extraction, we performed comparative genomic hybridization. Comparative genomic hybridization shows no significant chromosomal copy number changes. An idiosyncratic finding- a loss of a small pericentromeric area in chr. 9q was present. This area does not contain any tumor suppressor genes known to play a role in melanomagenesis. About 95% of conventional melanomas show significant losses or gains with this technique.  Using the DNA extracted for CGH, we also performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  An atypical Spitz tumor seems to be the best category for this lesion. These are neoplasms that have features more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results in sentinel lymph node biopsy having very limited predictive value, and in my opinion, sometimes leading to over-treatment if small deposits lead to completion lymphadenectomy. As the the base of the specimen is involved, conservative re-excision of this site is warranted.   Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	ATYPICAL SPITZ TUMOR	173610	644	\N	\N	17-132120	\N	DP-07	Possible TERT Fusion	IP1862784	AirTable blocks_with_IP_info.csv
