1447	11-12273	2	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.2	\N	\N	Sections show a cellular, exophytic, polypoid compound proliferation of melanocytes. Within the background epidermis, which is thin, there are single melanocytes and nests distributed erratically, and cells above the junction can be found. The dermis below this contains large and irregular nests of similar melanocytes that lack maturation with descent in the dermis. An increase in dermal vascularity is appreciable. Dermal melanocytes in mitosis are easily found.	Seven outside slides, S10-40898 A1 (DC11-357, DEE-12580) and one corresponding block.	LARGE PEARLY PAPULE ON L PINNA FOR 2-3 WEEKS; FAVOR PYOGENIC GRANULOMA	\N	Iwei, CGH Array run| ROS1 Translocation case	\N	Our differential diagnosis included childhood-type spitzoid melanoma on one hand and a peculiar cellular Spitz nevus on the other. To address this differential, we completed array-based comparative genomic hybridization (aCGH) analysis to screen for melanoma-associated genomic anomalies. After extraction of tumoral DNA from the tissue block, aCGH analysis demonstrated gain in chromosome 1q and loss of chromosome 6q. The identification of multiple chromosomal gains and losses is not known to occur in Spitz nevi and favors instead the above interpretation. The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination.  This proliferation has not been adequately excised. Further excision is warranted to ensure that local eradication has been accomplished.	CHILDHOOD-TYPE SPITZOID MELANOMA OF 2.9 MM IN THICKNESS	102270	653	\N	\N	11-12273	\N	DP-16	CGH Validation	IP1001710	AirTable blocks_with_IP_info.csv
1658	12-70514	6	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	173.4	\N	from Swapna	There is a compound proliferation of large, oval and fusiform melanocytes with abundant, pale amphophilic cytoplasm and large, vesicular nuclei. The lesion has a domed surface and a wedge shaped base. Cohesive aggregations of melanocytes are present within the superficial subcutis, without much dispersion or maturation. There are scattered mitotic figures in both the superficial and deep dermal parts of the lesion.	One hematoxylin and eosin-stained section prepared from outside block labeled L12-8883.	SPITZ; REFERRED FOR CGH OR FISH TESTING	\N	\N	\N	Comparative genomic hybridization shows multiple chromosomal aberrations indicative of melanoma. These include gains involving chromosomes 1p, 8q, and 11q, with losses involving chromosome 9, and a portion of 17q. Many of these are frequent aberrations in melanoma. Currently, I use the term Spitzoid melanoma, childhood type, for an emerging class of lesions that usually but not exclusively occur in children and teens, often lack b-raf mutations (which are present in most melanomas in adults) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma. These are findings that would support conservative treatment. Most lesions of this type are deeper, but usually not much wider than their exophytic portions, and even when they are, are well circumscribed. While sentinel nodes are often positive, this positivity has much less predictive value for systemic spread than is the case with adult melanoma.  The lesion is nominally 4.2 mm in thickness, but as implied above, the prognosis in cases of this type is considerably better than in adult melanomas of comparable thickness.	SPITZOID MELANOMA, CHILDHOOD TYPE	104444	647	\N	\N	12-70514	\N	DP-10	PRKC Fused Cases	IP1156331	AirTable blocks_with_IP_info.csv
