2144	17-61001	6	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	238.2	\N	\N	The microscopic findings are essentially as described in the accompanying pathology report and in the note above.	Two outside slides, D17-58 (A-B), and one corresponding block (1B).	CHANGING DARK PAPULE LEFT BUTTOCK; HEMOSIDEROTIC DX, SPITZ, BLUE NEVUS/CELLULAR	\N	\N	Scraping	Much of the lesion has a composition of classic Spitz cells, with a portion (including bulbous aggregations that protrude into the deep reticular dermis) that are composed of pulverocytes*. The latter raises the possibility of additional transformation, vs. the presence of a combined deep penetrating nevic component. This is not supported by a beta catenin immunostain, which shows only cytoplasmic membranous staining, and not nuclear staining, as we have seen in a proportion of deep penetrating nevi (manuscript in press, Nature Genetics). There is nearly complete loss of p16 staining, which can correlate with one of the common genomic aberrations seen in melanocytic neoplasm, bi-allelic loss of chr. 9p, where the gene, CDKN2A that encodes p16 is located. This loss of staining can also occur by epigenetic means, and is not entirely specific for melanoma.  A phosphohistone H3/MART-1/tyrosinase two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) shows at least one deep mitotic figure and several superficial melanocytes with positive nuclei.  Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows a loss involving chr. 9, but not in a pattern that would correlate with homozygous loss of CDKN2A, which encodes p16. There are near-threshold gains and losses around the centromere of chr. 10. These do not have breakpoints around known melanoma-associated genes. Dr. Boris Bastian also viewed the chr. 10 results, and would not make a diagnosis of melanoma based on them.  Following the same microdissection and DNA extraction for CGH, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  Given these findings, an atypical Spitz tumor may be the best category for this lesion. These are neoplasms that have features more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results in sentinel lymph node biopsy having very limited predictive value, and in my opinion, sometimes leading to over-treatment if small deposits lead to completion lymphadenectomy. The value of the latter is questionable, especially given the results of the multi-center trial just reported in N. Engl. J. Med. 2017 Jun 8;376(23):2211-2222.   Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.    *This term is introduced in Massi G, LeBoit P. Histologic Diagnosis of Nevi and Melanoma, 2nd Edition, Springer-Verlag, Berlin Heidelberg, 2014 p. 57, and refers to cells with abundant, pale cytoplasm and dusty appearing melanin, deriving from the Latin term for dust; such cells are only unusually present in Spitz's nevi	ATYPICAL SPITZ TUMOR	173507	245	\N	\N	17-61001	\N	CGH17-135	Nevus Library	IP1790788	AirTable blocks_with_IP_info.csv
