ave some applicability in this case. In keeping with this borderline character, comparative genomic hybridization shows an aberration not typically seen in melanoma. There is a gain involving chr. 9, which is often lost in melanoma. A re-excision of this area seems appropriate. In the reference below, the number of aberrations seen in blue nevus-like melanoma was higher than in atypical blue nevi or in conventional cellular blue nevi; with one aberration, and that one not typically associated with melanoma, this intermediate category seems best.  Reference:  Maize JC Jr, McCalmont TH, Carlson JA, Busam KJ, Kutzner H, Bastian BC. Genomic analysis of blue nevi and related dermal melanocytic proliferations. Am J Surg Pathol. 2005 Sep;29(9):1214-20.	ATYPICAL MELANOCYTIC PROLIFERATION ARISING IN A CELLULAR BLUE NEVUS	173788	648	\N	\N	14-15427	\N	DP-11	PRKC Fused Cases	IP1365348	AirTable blocks_with_IP_info.csv
