z's nevus, even though the 11p aberration is not an isolated one.  References:  van Engen-van Grunsven AC, van Dijk MC, Ruiter DJ, Klaasen A, Mooi WJ, Blokx WA. HRAS-mutated Spitz tumors: A subtype of Spitz tumors with distinct features. Am J Surg Pathol. 2010 Oct;34(10):1436-41.  Bastian BC, LeBoit PE, Pinkel D. Mutations and copy number increase of HRAS in Spitz nevi with distinctive histopathological features. Am J Pathol. 2000 Sep;157(3):967-72.	PREDOMINANTLY INTRADERMAL SPITZ'S NEVUS WITH SOME UNUSUAL FEATURES	102353	1579	\N	\N	11-41004	A	SYNX176	\N	IP1030443	Consolidated_data_final.csv
