3257	CGH13-008	20	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	\N	\N	There is a proliferation of large, oval and fusiform melanocytes with a domed surface, marked epidermal hyperplasia with blunt rete ridges, and dermal fascicles and nests of melanocytes with abundant, pale amphophilic cytoplasm and large, vesicular nuclei containing large nucleoli. Some mature with descent is evident. The enclosed Ki-67 stain is difficult to evaluate, as many nuclei in the dermis are positive but some may be those of infiltrating lymphocytes.	Seven outside slides, B12-200322 (S12-12868). One corresponding block received 12-3-12.	NO SPECIFIC CLINICAL INFORMATION GIVEN, MANY FEATURES IN COMMON WITH SPITZ'S NEVUS NOTED IN COVER LETTER, AS WELL AS LESS CHARACTERISTIC FEATURES	\N	\N	\N	A focus of lymphatic invasion is present in the superficial portion of the the scout section (the hematoxylin and eosin stained recut that we obtain at the time that sections are cut for immunoperoxidase stains). A p16 immunoperoxidase stain does not show loss of that tumor suppressor gene product. Immunoperoxidase staining using two colors (MART-1/tyrosinase labeled red, Ki-67 labeled brown) shows a very low proliferation rate in the dermal component, with only scattered melanocytes staining for the MART-1/tyrosinase component. The base of the specimen is focally involved. Comparative genomic hybridization shows loss of chromosome 14 q, and a gain of 22q. These chromosomal aberrations have been seen in melanoma, but are uncommon. In the face of the other findings and the young age of the patient I would not regard it as sufficient for a diagnosis of spitzoid melanoma. I would regard this lesion as equivalent to an atypical Spitz tumor; many series of such cases have shown only rare involvement beyond local nodes. The base of the specimen is focally involved.  My colleague, Dr. Boris Bastian has reviewed the comparative genomic hybridization data and agrees with this interpretation of it.	MOSTLY INTRADERMAL PRO