1425	10-88475	28	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	There is a well-circumscribed, dome-surfaced proliferation of melanocytes involving the junctional zone and superficial dermis. The base of the lesion is relatively flat, except in a central area where melanocytes extend along the access of an eccrine duct. The overlying epidermis is irregularly hyperplastic, with jagged rete ridges and a thick spinous layer. There are large, confluent nests of large oval melanocytes along the junction. These cells have monomorphous oval vesicular nuclei, small nucleoli and abundant pale eosinophilic cytoplasm. Many mitotic figures are present, both in the superficial and deep portions of the lesion. There is some maturation with descent, and in the central, peri-adnexal area, some myxoid stroma is present.	Four outside slides, B8538/10. One corresponding block received 1-14-11.	PIGMENTED PAPULE	\N	\N	\N	ADDENDUM, February 14, 2011: The following note has been modified from that in the original report, a copy of which is on file as .pdfs in our computer system: While the architectural features of this lesion favor a Spitz's nevus, some of the cytologic features are of concern (many cells have less cytoplasm than classic Spitz cells typically do), and many more mitotic figures are present than in most Spitz nevi. Additionally, the striking confluence of junctional nests is of concern.  Comparative genomic hybridization shows no chromosomal gains or losses. Given these findings, I am unable to render a diagnosis of spitzoid melanoma, and favor a unusual Spitz's nevus. The lesion appears to have been removed with a margin of about 3 mm on one side. It is very well circumscribed, and lesions of this type seldom recur in the scar from the previous biopsy. Also, it is very common for spitzoid lesions of all types (including benign Spitz nevi) to have small clusters of spitzoid melanocytes in a sentinel lymph node. The predictive value of this finding is very low, and I, f