1933	16-20360	46	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	The microscopic findings are essentially as described in the accompanying pathology report.	Six outside slides, SH-16-9238-A1, and one corresponding block.	ERYTHEMA, RAISED, ABOUT 1.2 CM DIAMETER, LOOKS INFLAMED, ITCHY	\N	\N	\N	The differential diagnosis includes an atypical Spitz tumor and a spitzoid melanoma. Following microdissection and DNA extraction, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations.  Following the above DNA extraction, we performed comparative genomic hybridization, and found losses involving chrs. 9 and 10. These are commonly found in melanoma. The chr. 9 loss appears to be heterozygous, as p16 is preserved by immunohistochemistry. Putting this all together, the maturation and dispersion with descent, and absence of hTERT promoter mutation are against a fully malignant neoplasm while the comparative genomic hybridization result somewhat favors melanoma, but not as much as if there was a homozygous chr. 9 or 9p loss.  An atypical Spitz tumor may be the best category for this lesion. These are neoplasms that have features more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results in sentinel lymph node biopsy having very limited predictive value, and in my opinion, sometimes leading to over-treatment if small deposits lead to completion lymphadenectomy.   Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	PREDOMINANTLY INTRADERMAL PROLIFERATION OF LARGE, SPITZOID MELANOCYTES, FAVOR AN ATYPICAL SPITZ TUMOR	173649	694	\N	\N	16-20360	\N	DP-57	CGH Validation	IP1619491	AirTable blocks_with_IP_info.csv
