lthood are not known to be predictive of prognosis in the pediatric setting.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	SPITZOID MELANOMA OF AT LEAST 2.9 MM IN THICKNESS, INCOMPLETELY EXCISED	173716	681	\N	\N	15-60391	\N	DP-44	CGH Validation	IP1531774	AirTable blocks_with_IP_info.csv
1883	15-61456	44	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show melanocytes arrayed as many large fascicles in the epidermis with acanthosis, and good lateral demarcation is noted. There are maturing fascicles in the perijunctional dermis jointly with slight myxoid change and a lymphohistiocytic infiltrate.	One outside slide, DE-15-009578 and one corresponding block\nSeven outside slides, DE-12-013912 A1.	6 MM RED-BROWN SYMMETRIC PLUMP PAPULE, FATHER DIED AT AGE 62 OF METASTATIC MELANOMA IN 2012, THREE MONTHS AFTER BEING DIAGNOSED, ALSO INCLUDED FOR REFERENCE IS AN EARLIER BIOPSY OF ANOTHER LESION (LEFT INNER CALF) BIOPSIED IN 2012	\N	\N	\N	This addendum report has been issued to comprehensively document the date of service. Molecular assessment (the results of which are discussed below) was initiated on July 29, 2015. Data became available during the subsequent week, and my final interpretation of the molecular data was completed on August 7, 2015. As I have discussed with you, this biopsy demonstrates a configuration that fits with a diagnosis of 'NTRK1-oma', namely a Spitz nevus/tumor with associated NTRK1 gene fusion. NTRK1 immunohistochemistry has been completed and demonstrates remarkable positivity, and this labeling result implies that underlying NTRK1 gene fusion has occurred. Gene fusion is merely a mechanism of tumor development and does not provide information regarding clinical behavior, but my impression, based upon histopathologic characteristics, is that this tumor is only partially transformed and thus holds no adverse clinical implications.  Given the high clinical concern, we completed ancillary assessment to further substantiate the nature of this tumor. This was completed by array-based comparative genomic hybridization (aCGH) to screen for genomic copy number anomalies, as would be expected with melanoma. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed no chromosomal gains or losses. As background for understanding this result, note that most melanomas analyzed via aCGH demonstrate multiple associated chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of melanoma. Rather, I believe this tumor is unusual but essentially equivalent to a melanocytic nevus. Dr. Rosenman should follow the site to verify that no persistence ensues, if no reexcision is planned.  Please note that I have also retrospectively reviewed a 2012 biopsy from this patient as part of my evaluation. My retrospective diagnosis for the prior specimen is that it demonstrates a 'pagetoid' pigmented spindle cell nevus. Some tumors within the spectrum of pigmented spindle cell nevus are induced by NTRK1 gene fusion, and thus it is conceivable that this patient's prior tumor and current tumor are mechanistically related. We understand that the old tissue block has been exhausted, and thus no further testing in that regard will be possible.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	COMPOUND SPITZ TUMOR/NEVUS WITH ASSOCIATED NTRK1 GENE FUSION, EXCISED IN THE AVAILABLE PLANES OF SECTION	105575	682	\N	\N	15-61456	\N	DP-45	CGH Validation	IP1532843	AirTable blocks_with_IP_info.csv
1884	15-71393	7	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	There is a compound proliferation of melanocytes with a domed surface, epidermal hyperplasia, a few moderately sized nests at the dermo-epidermal junction and nests, cords and strands in a peri-adnexal pattern in the dermis. The superficial melanocytes have moderately large amounts of cytoplasm and enlarged nuclei, with small, round melanocytes predominating toward the base of the lesion.	Eight outside slides, P15-16595-A1, including five unstained slides. One corresponding block received 8/5/15.	NEW FIRM HYPERPIG NODULE; R/O ATYPIA	\N	\N	\N	The features seemed in part to be a mixture of those of a Spitz's nevus and those of a superficial congenital nevus, but some raised the possibility of a nevoid melanoma, necessitating additional studies. As some Spitz's nevi with cells that have less cytoplasm than usual have NTRK1 gene fusions, I obtained that immunostain, but the strong staining seen in that situation is not present. A p16 immunostain shows that this tumor suppressor protein is retained only in a minority of cells, but these are distributed evenly, and not in a pattern suggesting loss of p16 in a clonal population, as could reflect bi-allelic loss of CDKN2A as would favor melanoma. A phosphohistone H3/Melan-A two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) has now been repeated (the first try resulted in a slide in which much of the tissue had fallen off), and shows a marginal mitosis as well as one in the mid-portion of the lesion.  Marginal mitoses are mentioned in the reference below as a finding favoring melanoma over Spitz's nevus, and also emerged in the results of an expert panel in 2008 evaluating melanocytic neoplasms of unknown malignant potential.  Given this finding, I suggested comparative genomic hybridization, which has now been completed. It shows multiple chromosomal gains and losses, indicating a level of genomic instability found in melanoma and not in nevi. These include loss of chr. 1p, chr. 2, gain of 4q, loss of 5, gain of 6p and loss of 6q, gains of 7 and 8, losses of 9 and 10, loss of 13, gain of 15, loss of 16 and gain of 19. Many of these are copy number changes often found in melanoma.  A recent study from St. Jude's Medical Center, referenced below suggests that hTERT mutation analysis is more important than chromosomal copy number changes in determining the potential for childhood spitzoid melanomas to spread beyond local nodes. In this case, this may not be as important, as the morphology is more nevoid than spitzoid. This testing is not commercially available, but we hope to have it set up in our lab in several months time. In the interim, it is available at St. Jude's, but only for patients being seen there clinically.  References:  Crotty KA. Spitz naevus: histological features and distinction from malignant melanoma. Australas J Dermatol. 1997 Jun;38 Suppl 1:S49-53.  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	MELANOMA, 2.3 MM. IN THICKNESS	173719	683	\N	\N	15-71393	\N	DP-46	CGH Validation	IP1542843	AirTable blocks_with_IP_info.csv
