2058	17-13205	11	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	The microscopic findings are essentially as described in the accompanying pathology report and in the note above.	Three outside slides, SU17-1576-1 (AX17-96), and one corresponding block.	SECOND OPINION, REQUEST FOR GENETIC STUDIES IN COVER LETTER FOLLOWING DISCUSSION WITH CLINICIAN	\N	\N	\N	As you note, the differential diagnosis includes an atypical Spitz tumor and a spitzoid melanoma. The findings are more atypical than those of a Spitz's nevus. The worrisome aspects include variable cellularity at the same stratum of the dermis, the degree of nuclear pleomorphism and heterochromasia, and mitotic figures relatively deep in the lesion. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows losses involving chromosomes 9, 13 and 14, and a gain involving chr. 15. While chromosome 9 loss is common in melanoma, it can occur as an isolated finding in benign spitzoid neoplasms. In this case, it is not accompanied by other common chromosomal copy number changes seen in melanoma, but by two relatively idiosyncratic ones (loss of chrs. 13 and 14) and by an intermediate frequency one.  Following the same microdissection and DNA extraction, we also performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  Given these findings, I favor an atypical Spitz tumor with a low risk of extranodal spread, but a higher one that if the CGH profile had been negative. My colleague, Dr. Boris Bastian also viewed the CGH array data and agrees with this interpretation of it. If it has not yet been done, a narrow re-excision of this site seems prudent.  Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	INTRADERMAL PROLIFERATION OF LARGE, SPITZOID MELANOCYTES, SEE COMMENT	173719	730	\N	\N	17-13205	\N	DP-93	CGH Validation	IP1742388	AirTable blocks_with_IP_info.csv
