ning concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  Taking these findings into account together with the histopathologic findings, an atypical Spitz tumor may be the best category for this lesion. These are neoplasms that have features more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results in sentinel lymph node biopsy having very limited predictive value, and in my opinion, sometimes leading to over-treatment if small deposits lead to completion lymphadenectomy. The neoplasm extends to the base of the specimen, and a narrow re-excision still seems warranted.   Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	COMPOUND PROLIFERATION OF LARGE SPITZOID MELANOCYTES, FAVOR AN ATYPICAL SPITZ TUMOR	173305	715	\N	\N	16-105648	\N	DP-78	CGH Validation	IP1705676	AirTable blocks_with_IP_info.csv
