1966	16-80354	56	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	An excisional specimen demonstrates a compound proliferation of enlarged fusiform melanocytes with finely pigmented cytoplasm. There are single melanocytes and nests and fascicles of melanocytes present within the epidermis, and limited suprajunctional scatter can be seen. In the dermis below this, the fusiform melanocytes mature as coalescing nests, fascicles, and syncytia, and a scattered infiltrate of lymphocytes and melanophages can be seen. The dermis is elastotic.	Three outside slides, DPR-16-8373-A1, and one corresponding block.	6 MM DEEP BROWN PAPULE WITH ECCENTRIC RED BORDER; DYSPLASTIC NEVUS VS. MELANOMA	\N	\N	\N	My differential diagnosis included a deep penetrating nevus (plexiform spindle cell nevus), a variant of Spitz nevus, and melanoma. Your submitted immunostain for p16 shows partial loss of expression, and this finding is diagnostically inconclusive (although a loss of chromosome 9 was ultimately confirmed to be present, as is discussed in the paragraph that follows). To further evaluate this tumor, we completed phosphohistone-H3 immunostaining to assess the mitotic index. In the resultant immunostain, rather dramatic maturation is apparent, and only a small number of perijunctional melanocytes in mitosis can be identified. To clarify the differential diagnosis, we completed array-based comparative genomic hybridization (aCGH) to screen for chromosomal copy number gain or loss. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosomes 12p and 15q as well as loss in chromosomes 1p, 2p, centromeric 7p, 9, centromeric 12q, 13q, 17, and 18. The identification of multiple chromosomal copy number abnormalities indicates genomic instability, as is typical of melanoma. In short, the aCGH result confirms the diagnosis of melanoma and excludes any type of melanocytic nevus from the differential diagnosis.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.  Synoptic melanoma reporting is included below.  Procedure: narrow excision Microscopic tumor type: melanoma NOS Breslow thickness: 1.05 mm Ulceration: not detected Margin: narrow / equivocal Mitotic index: 1 per square mm Vascular invasion: not detected Regression: not significant Pathologic staging (pTNM): pT2aNxMx	MELANOMA OF 1.05 MM IN THICKNESS, NARROWLY EXCISED IN THE AVAILABLE PLANES OF SECTION	173726	710	\N	\N	16-80354	\N	DP-73	CGH Validation	IP1680083	AirTable blocks_with_IP_info.csv
1971	16-89926	36	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show melanocytes arrayed focally in the epidermis with acanthosis, and partially maturing nests, cords, and fascicles of melanocytes are in collagenous dermis below this. The cells of interest are enlarged and often fusiform. A lymphohistiocytic infiltrate is noted.	Five outside slides, ST16-4992-A1, and one corresponding block.	NO HISTORY OF PREVIOUS MELANOMA	\N	\N	\N	My differential diagnosis included a large desmoplastic Spitz nevus, an HRAS-mutated Spitz nevus, and a kinase fusion Spitz nevus. Immunostaining demonstrated mosaic expression of p16, and thus biallelic loss in CDKN2A is not present in association with this tumor (the fact that there is not CDKN2A loss at all was subsequently documented by molecular methods, as is discussed in the paragraph that follows). An ALK stain is negative, and thus underlying ALK gene fusion is not present. My residual differential included an HRAS-mutated desmoplastic Spitz nevus, and array-based comparative genomic hybridization (aCGH) was completed to fully clarify the diagnosis. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosome 11p as a monoaberration with no other associated chromosomal gains or losses. As background for understanding this result, note that most melanomas analyzed via aCGH demonstrate multiple associated chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations. The identification of gain in chromosome 11p is highly correlated with HRAS mutation, and this finding corroborates the diagnosis of HRAS-mutated Spitz nevus.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of melanoma. Rather, our analysis confirms that this represents a variant of Spitz nevus, namely a Spitz nevus with HRAS mutation and gain. With respect to management, the inked edge of the specimen is focally involved, and thus conservative complete reexcision can be considered as a means to prevent persistence.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5. Please note that this reference includes discussion of a tumor with characteristics similar to this one.	HRAS-MUTATED DESMOPLASTIC SPITZ NEVUS	173450	711	\N	\N	16-89926	\N	DP-74	CGH Validation	IP1689756	AirTable blocks_with_IP_info.csv
1972	16-90917	40	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.5	\N	\N	The microscopic findings are essentially as described in the accompanying pathology report and in the note above.	Seven outside slides, KA16-20753 (A1-A2), and one corresponding block (A2).	IRREGULAR BROWN MACULE; DYSPLASTIC NEVUS	\N	\N	\N	The majority of features in the submitted slides favored an atypical Spitz tumor over spitzoid melanoma. The lesional melanocytes have monomorphous nuclei, and in most of the lesion nests are moderately sized superficially, and quite small along the base of the lesion. However, there were some areas in which disproportionately large nests are present toward the lesional base. Given this feature, I obtained comparative genomic hybridization. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows multiple chromosomal gains and losses, indicating a level of genomic instability found in melanoma and not in nevi. There are losses involving chromosomes 1p, 3p, 6q, 8p, 12p and 17q and a gain involving 8q. There are sub-threshold, possible aberrations as well- possible loss of 14 and possible gains of 1q and 6p. Some of the above chromosomal copy number changes are typical ones seen in melanoma.  Given these findings, I favor treating this lesion as melanoma, despite the findings by morphology and immunohistochemistry.	MELANOMA, 2.2 MM. IN THICKNESS	173507	712	\N	\N	16-90917	\N	DP-75	CGH Validation	IP1690755	AirTable blocks_with_IP_info.csv
