2078	17-26078	2	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	There is a zone of fibrosing granulation tissue, adjacent to which is a vertically oriented compound pan-dermal and superificial subcutaneous proliferation of large, oval melanocytes. These cells of interest form very large nests associated with irregular epidermal hyperplasia, foci of erosion, some suprabasilar scatter, some dispersion in the deep reticular dermis, and a large vertically oriented oval mass in the subcutis. Many mitotic figures are present superficially and a few more deeply.	Two outside slides, P17-1100 (A-B). One corresponding block (B) received 3/27/17.	NEVUS	\N	\N	\N	The very large size of the superficial nests, the number of mitotic figures within them, and the large bulbous mass that protrudes into the superficial subcutis are features that lie beyond those of a Spitz's nevus and make the differential diagnosis between that of an atypical Spitz tumor and a spitzoid melanoma. Some relatively deep mitotic figures are present as well. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows a complex pattern of gains and losses on chr. 3p including an amplification of an area around MiTF. While the area of loss encompassed the BAP-1 gene on chr. 3p, no loss of BAP-1 was seen by immunohistochemistry, making it unlikely that a BAP-1 mutation was present. MiTF amplifications are usually found in high grade melanomas, and seldom in spitzoid lesions in children. There is a loss of chr. 6q, and a gain of chr. 7. A gain of part of chr. X is also present. The chr. 6q loss has a copy number transition around ROS1, which can point to a ROS gene fusion.  Following microdissection and DNA extraction, we performed sequencing of the hTERT promoter gene. This test detects TERT promoter mutations on chromosome 5 between nucleotides 1,295,155 to 1,295,355; including mutations at g.1295161 A>C; g.1295228 C>T; g.1295250 C>T. Such mutations occur in melanoma, and in the context of atypical spitzoid neoplasms have been linked to the capacity for spread beyond local lymph nodes. No mutations were found, lessening concern regarding the chance for such spread. In the study cited below, the only cases with fatal outcomes were in patients who had hTERT promoter mutations. Since then, there have been a few cases in which hTERT promoter mutations were not found, but in which the gene was affected by promoter methylation.  In sum, while the hTERT promoter gene was wild type, the findings by CGH included MiTF amplification, which in addition to the other chromosomal copy number changes favors melanoma. My colleague Dr. Iwei Yei also reviewed the sections and CGH data, and agree with this interpretation. I would note that spitzoid melanomas in children have a much better prognosis than conventional ones of the same thickness in adults. The neoplasm extends to the base of the specimen.  Reference:  Lee S, Barnhill RL, Dummer R, Dalton J, Wu J, Pappo A, Bahrami A. TERT Promoter Mutations Are Predictive of Aggressive Clinical Behavior in Patients with Spitzoid Melanocytic Neoplasms. Sci Rep. 2015 Jun 10;5:11200. doi: 10.1038/srep11200. PubMed PMID: 26061100; PubMed Central PMCID: PMC4462090.	MELANOMA, 4.5 MM. IN THICKNESS	173701	728	\N	\N	17-26078	\N	DP-91	CGH Validation	IP1755396	AirTable blocks_with_IP_info.csv
