1270	07-04365	59	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	Sections show an asymmetrical, compound proliferation of melanocytes, many of which have atypical nuclei. Many of the junctional melanocytes have spindled or epithelioid cytology, and there are some perimelanocytic clefts. There are many melanocytes present above the basal layer. The epidermis is thinned overlying some of the junctional nests. Small Kamino bodies are evident. There are irregular clusters of similar melanocytes in the underlying dermis, and also, a subtle population of perhaps slightly smaller melanocytes towards the base. These are in continuity with larger melanocytes in general, however. The overlying epidermis is thickened and hyperkeratotic, and there are also areas of thinning of the epidermis as noted. The proliferation is fairly well-circumscribed, although there are minor defects in lateral circumscription noted. There is surrounding slight solar elastosis, and a patchy lymphocytic infiltrate. The papillary dermis is focally fibrotic.	Slightly irregular ellipse, 1.7 x 1.1 x 0.3 cm, including a central brown 0.7 x 0.5 cm area.  With margins inked blue, the specimen is serially sectioned perpendicular to the long axis and entirely submitted with six sections.	R/O MELANOMA	\N	\N	\N	This example of melanoma has a pattern reminiscent of that seen in a Spitz's nevus. However, it is broad, markedly asymmetrical, and demonstrates focal defects in circumscription. There are even occasional Kamino bodies, which are relatively small but well formed, a feature also seen in Spitz's nevi. There is a population of somewhat smaller cells in some areas as well. Thus, although this would be an unusual occurrence, we cannot completely exclude the possibility of melanoma arising in a background of Spitz's nevus. I have also shared this case with my colleagues, Drs. Philip LeBoit and Timothy McCalmont, who agree with these findings. In terms of staging, this is a non-ulcerated primary melanoma of Clark's anatomic level at least III, filling and expanding the papillary dermis. I cannot completely exclude the possibility of superficial involvement of the reticular dermis, as the interface is obscured by the tumor and by a lymphocytic infiltrate. There is no evidence of vascular invasion, neurotropism, or regression. There are also no microsatellites noted. Complete excision is of course warranted.	MELANOMA, WITH SPITZOID FEATURES, 0.8 MM IN THICKNESS, EXTENDING WITHIN THE EPIDERMIS TO WITHIN 2 MM OF THE PERIPHERAL MARGIN	173701	2149	\N	\N	07-4365	\N	SYNAT590	Spitzoid Melanoma	IP617346	AirTable blocks_with_IP_info.csv
