1643	12-48249	54	\N	\N	\N	T1a	Primary	None	\N	\N	\N	\N	\N	172.5	\N	\N	There is a compound proliferation of melanocytes involving the epidermis and superficial dermis. The lesion is broad, has a slightly domed surface, and where it can be ascertained, appears well circumscribed. There are evenly elongated, round-based rete ridges, some of which are bridged by oval nests of large oval melanocytes that have abundant pale cytoplasm and slightly enlarged nuclei. Single melanocytes with scant cytoplasm are also present in the basal layer of the epidermis in between the ridges, and very focally above them. Within the superficial dermis, especially in the center of the lesion are poorly formed fascicles of spindled melanocytes with scant cytoplasm and variably sized, hyperchromatic nuclei. Toward one edge of the specimen, the dermis contains vertically oriented vessels and closely apposed, thin collagen bundles.	Five outside slides, D12-18979:1 and 2. Two corresponding blocks received 7-5-12.	R/O RECURRENT DYSPLASTIC NEVUS	\N	\N	\N	ADDENDUM, July  5, 2012: The following note has been modified from that in the original report, a copy of which is on file as a .pdf in our computer system: The neoplasm extends to the peripheral edge of the specimen.  The melanocytic proliferation has the overall architectural features of a dysplastic nevus, but has very large and confluent junctional nests, and a dermal component with some desmoplastic features. The differential diagnosis included an unusual dysplastic (Clark's) nevus and a dysplastic nevus-like pattern of melanoma.  Comparative genomic hybridization shows many chromosomal gains and losses, indicative of a level of genomic instability seen in melanoma and not in nevi. These included losses involving chromosome 3q, 8p, and 9p, and multiple areas of gains and losses on chromosome 11q. Losses of 9p are the most common aberrations in melanoma, and while not specific, when associated with other abnormalities point to that diagnosis.