1964	16-77392	36	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	A shave biopsy demonstrates a compound proliferation of large epithelioid and fusiform melanocytes with pale pigmented cytoplasm. These cells are distributed in giant nests and fascicles that are stuffed in dermal papillae below a thinned epidermis, and interstitial cords and fascicles of similar melanocytes extend in badly-circumscribed fashion in the dermis below this. A patchy infiltrate of lymphocytes and melanophages is present concurrently. Scattered cells in mitosis are identifiable, and some of these have been marked within the submitted slides.	One outside slide, JS-16-43216-A1. One block received 8-18-16.	IMPRESSION WAS DERMATOFIBROMA VS. VASCULAR VS. ATYPICAL NEVUS	\N	\N	\N	As has been clear from prior reporting of this case, this specimen does not contain any type of conventional melanocytic nevus. Rather, this tumor shows many histopathologic features that were considered worrisome for nevoid melanoma with pseudomaturation. The gargantuan nests of melanocytes that are present superficially and the elevated mitotic index are both features that were considered to be of concern. I additionally considered the possibility of an epidermotropic metastasis of melanoma in my differential diagnosis. However, that would only be germane in the context of a patient with an existing history of melanoma and thus can be excluded in the interpretation of this specimen. To add additional diagnostic information, we completed array-based comparative genomic hybridization (aCGH) to screen for chromosomal copy number gain or loss, as can be seen in association with melanoma. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosome 11p as well as loss in chromone 22q with no other associated genomic gains or losses. Loss in chromosome 22q is a rare molecular finding and is likely of no larger significance. Gain in chromosome 11p has been identified in a subset of Spitz tumors and is highly correlated with underlying HRAS mutation.  In summary, the combination of results derived from conventional microscopy coupled with aCGH suggests that this proliferation represents an HRAS-mutated Spitz tumor rather than a frank melanoma. What is unusual about this case is that the microscopic findings are quite different from most examples of that entity. With that said, the molecular findings seem clear cut. Long-term follow-up studies of HRAS-mutated Spitz tumors suggests that they are functionally benign and thus are of no larger clinical significance. As the deep edge of this biopsy is involved, conservative reexcision is recommended to be certain that full local removal has been accomplished.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5. Please note that this citation includes a discussion of an HRAS-mutated tumor with histopathologic findings that are more conventional of this entity, in contrast to the findings seen here.	COMPOUND MELANOCYTIC TUMOR WITH ASSOCIATED GENOMIC GAIN IN CHROMOSOME 11p, FOCALLY INVOLVING THE DEEP EDGE OF THE BIOPSY	173628	709	\N	\N	16-77392	\N	DP-72	CGH Validation	IP1677083	AirTable blocks_with_IP_info.csv
